import React, { Component } from 'react'
import  './Adminmain.css';
const Adminmain=()=>{
    return(
      <div style={{display}}>
        <div class="vertical-menu">
        <a href="#" class="active">Home</a>
        <a href="#">Link 1</a>
        <a href="#">Link 2</a>
        <a href="#">Link 3</a>
        <a href="#">Link 4</a>
      </div>
      </div>
    )
}
export default Adminmain;
